// Compiler result to JSON file
import { createComponent } from 'js/declViewModelService';
import { registerDynImportEntry } from 'js/moduleLoader';
import AwParseService from 'js/awParseService';
import AwFilterService from 'js/awFilterService';
import { getField } from 'js/utils';
import { Fragment } from 'react';
let filterSer = AwFilterService.instance;



/*
render function
*/
import { awInContentSearchBoxRenderFunction } from 'js/AwInContentSearchBoxService';


/*
ctx imports
*/

const ctxImportObj = {  };


/*
dynamic import
 */
registerDynImportEntry('js/AwInContentSearchBoxService', () => import('js/AwInContentSearchBoxService'));;

/*
view model
 */
const declViewModelJson = {
    "schemaVersion": "1.0.0",
    "actions": {
        "render": {
            "method": "awInContentSearchBoxRenderFunction",
            "deps": "js/AwInContentSearchBoxService"
        },
        "syncUpIncontextTextBox": {
            "actionType": "JSFunction",
            "method": "syncupTextbox",
            "inputData": {
                "searchState": "{{props.searchState}}",
                "inputField": "{{props}}"
            },
            "deps": "js/AwInContentSearchBoxService"
        }
    },
    "data": {
        "focused": false
    },
    "i18n": {
        "inContentSearchPlaceHolder": [
            "SearchMessages"
        ]
    },
    "conditions": {},
    "onEvent": [],
    "lifecycleHooks": {
        "render": "render",
        "onUpdate": [
            {
                "action": "syncUpIncontextTextBox",
                "observers": [
                    "props.searchState.criteria.searchString"
                ]
            }
        ]
    },
    "props": {
        "prop": {
            "type": "field"
        },
        "search-state": {
            "type": "object"
        }
    },
    "_viewModelId": "AwInContentSearchBox",
    "_uniqueViewModelId": "AwInContentSearchBox",
    "ctx": {}
};




/*
define component
*/
const Component = createComponent( declViewModelJson, awInContentSearchBoxRenderFunction, undefined, ctxImportObj );

export default Component;
